import re

def wordCount(s: str) -> dict:
    words = re.findall('', s.lower())
    word_count = {}
    for word in words:
        word_count[word] = word_count.get(word, 0) + 1
    return dict(sorted(word_count.items(), key=lambda x: x[1], reverse=True))

